function get_database()
{
    return _get_database("hidden-machine");
}

function create_database() {
    var db =  _create_database("hidden-machine");

//    load_database(db);

    return db;
}

function get_human_database()
{
    return _get_database("hm-human");
}

function create_human_database() {
    return _create_database("hm-human");
}

function _get_database(name) {
    return openDatabase( name, "1", "hidden-machine database of turns/moves", 5 * 1024 * 1024 ); // 5 mb
}

function _create_database(name)
{
    var db = openDatabase( name, "1", "hidden-machine database of turns/moves", 5 * 1024 * 1024 ); // 5 mb

    var tb_state = " CREATE TABLE IF NOT EXISTS tb_state ( " +
                    " state INTEGER NOT NULL PRIMARY KEY ASC AUTOINCREMENT, " +
                    " my_pokemon STRING NOT NULL, " +
                    " en_pokemon STRING NOT NULL, " +
                    " my_type STRING NOT NULL, " +
                    " en_type STRING NOT NULL, " +
                    " my_status STRING NOT NULL, " +
                    " en_status STRING NOT NULL, " +
                    " my_hazards STRING, " +
                    " en_hazards STRING, " +
                    " weather STRING, " +
                    " move STRING NOT NULL, " +
                    " rating INTEGER NOT NULL " +
                    " ) ";

    db.transaction( function(tx) {
        tx.executeSql( tb_state );
    } );

    return db;
}

function insert_state( db, my_pokemon, en_pokemon, my_type, en_type, my_status, en_status, my_hazards, en_hazards, weather, move, rating )
{
    var sql = " INSERT INTO tb_state ( my_pokemon, en_pokemon, my_type, en_type, my_status, en_status, my_hazards, en_hazards, weather, move, rating ) VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, ?) ";

    db.transaction( function(tx) {
                                     tx.executeSql( sql, [my_pokemon, en_pokemon, my_type, en_type, my_status, en_status, my_hazards, en_hazards, weather, move, rating] );
                                 } );
}

function get_states( db, column, value, callback ) 
{
    var sql = " SELECT * FROM tb_state WHERE " + column + " = '" + value + "' ORDER BY rating DESC ";
    var retval = [];

    db.transaction( function(tx) {
            tx.executeSql( sql, [], function(tx, results) {
                for ( var i = 0; i < results.rows.length; i++ ) {
                    var row = results.rows.item(i);
                    retval[i] = {
                                    state      : row['state'],
                                    my_pokemon : row['my_pokemon'],
                                    en_pokemon : row['en_pokemon'],
                                    my_type    : row['my_type'],
                                    en_type    : row['en_type'],
                                    my_status  : row['my_status'],
                                    en_status  : row['en_status'],
                                    my_hazards : row['my_hazards'],
                                    en_hazards : row['en_hazards'],
                                    weather    : row['weather'],
                                    move       : row['move'],
                                    rating     : row['rating']
                    };
                }
                callback(retval);
                } );
            } );
}

